import React from "react";

const Book = (props) => {
  return (
    <div>
      <h2>{props.book.title}</h2>
      <img alt="" src={props.book.img} />
      <button>Add Comment</button>
      <button>Show all Comments</button>
    </div>
  );
};

export default Book;
